export function cleanUrlString(str: string): string {
  try {
    const urlPartsMatch = str.match(/"urlParts":\[(.*?)\],\"initialTree\"/);
    if (!urlPartsMatch?.[1]) return str;

    const urlParts = urlPartsMatch[1]
      .split(',')
      .map((part) => part.replace(/^"|"$/g, '').replace(/\\"/g, '"'))
      .map((part) => {
        if (!part.includes('?')) return part;

        const [path, query] = part.split('?');
        const cleanQuery = query
          ?.split('&')
          .filter(
            (param) =>
              !param.startsWith('f.turnTheNewKlarnaCheckoutOn=') &&
              !param.startsWith('_rsc=')
          )
          .join('&');

        return cleanQuery ? `${path}?${cleanQuery}` : path;
      });

    const cleanJson = urlParts
      .map((part) => `"${part.replace(/"/g, '\\"')}"`)
      .join(',');

    return str.replace(
      urlPartsMatch[0],
      `"urlParts":[${cleanJson}],"initialTree"`
    );
  } catch (error) {
    return str;
  }
}

